import React from "react";
import ErrorBoundary from "./ErrorBoundary";

const Hero=({Heroname})=>{
    if(Heroname=='Joker')<ErrorBoundary/>;
    return(
        <div>
            <h1>Hero- {Heroname}</h1>
        </div>
    )
}

export default Hero;
